import { useEffect, useState } from "react";
import style from "./Form.module.css"

const Form = ()=>{

    const [form, setForm] = useState({
        name:"",
        weight:"",
        height:"",
        life_span:"",
        temperament:[],
        image:""
    })

    const [weightH, setWeightH] = useState({
        min:"",
        max:""
    })

    const [heightH, setHeightH] = useState({
        min:"",
        max:""
    })

    const [tempH, setTempH] = useState([])

 const changeHandler = (event) => {
        const property = event.target.name;
        const value = event.target.value;
      
        setForm({ ...form, [property]: value });
      };
      
const weightHandler = (event) => {
    const property = event.target.name;
    const value = event.target.value;
      
    setWeightH({ ...weightH, [property]: value });
}

     
const heightHandler = (event) => {
    const property = event.target.name;
    const value = event.target.value;
      
    setHeightH({ ...heightH, [property]: value });

};

const tempHHandler = (event) => {
    const property = event.target.name;
    const value = event.target.value;
      
    setTempH({ ...tempH, [property]: value });
}

const handleSubmit = (event) => {
        event.preventDefault(); //! Asi no recarga la pag cuando tocamos enter
};

useEffect(() => {
    const finalWeight = [weightH.min, "-", weightH.max].join(" ");
    setForm((prevForm) => ({ ...prevForm, weight: finalWeight }));
  }, [weightH]);

useEffect(() => {
    const finalHeight = [heightH.min, "-", heightH.max].join(" ");
    setForm((prevForm) => ({ ...prevForm, height: finalHeight }));
  }, [heightH]);
   
useEffect(()=>{
    const finalTemp = [];
    finalTemp.push(tempH);
    setForm((prevForm)=> ({...prevForm, temperament:finalTemp}))
})
    return(
        <body >
        <box className={style.ref1}></box>
        <box className={style.ref2}></box>
        <form className={style.form}>
            <div>
                <label></label>
                <input 
                type="text"
                placeholder="Name" 
                value={form.name} 
                onChange={changeHandler} 
                name="name">
                </input>         
            </div>

            <>-----------</>

            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Weight Min" 
                onChange={weightHandler}
                name="min"
                value={weightH.name}>
                </input> 
                <> Kg </>      
            </div>

            <div>
                <input 
                type="text" 
                placeholder="Weight Max"
                onChange={weightHandler}
                name="max"
                value={weightH.name}>
                </input>  
                <> Kg </>  
            </div>

            <>-----------</>

            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Height Min"
                name="min" 
                onChange={heightHandler}
                value={heightH.value}>
                </input> 
                <> Cm </> 
            </div>
            
            <div>
                <input 
                type="text" 
                placeholder="Height Max"
                name="max" 
                onChange={heightHandler}
                value={heightH.value}>
                </input>   
                <> Cm </>        
            </div>

            <>-----------</>

            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Life expectancy" 
                value={form.life_span} 
                onChange={changeHandler} 
                name="life_span">
                </input>
                <> Years </>          
            </div>

            <>-----------</>
            
            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Temperaments" 
                name="temperaments"
                onChange={tempHHandler}
                value={tempH}>
                </input>         
            </div>

            <>-----------</>

            <div>
                <label>Ingrese URL</label>
                <input 
                type="text" 
                value={form.image}>
                </input>        
            </div>

            <div>
                <label></label>
                <input 
                type="submit" 
                onSubmit={handleSubmit}>
                </input>         
            </div>
        </form>
        </body>
    )
}

export default Form;
